export default (function(a,b,c,d,e){return {data:{klyztT6ruh:{data:{id:539,attributes:{imdbId:"tt2056366",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTYwNjEwMDcyM15BMl5BanBnXkFtZTgwMzIyMDA1MDE@._V1_SX300.jpg",type:"series",ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"}],item_lang:{data:{id:1202,attributes:{title:e,plot:"Carrie Bradshaw is in her junior year of high school in the early 1980s. She asks her first questions about love, sex, friendship and family while navigating the worlds of high school and Manhattan.",slug:"the-carrie-diaries"}}},books:{data:[{id:3952,attributes:{title:"The Carrie Diaries (TV tie-in)",description:"Meet Carrie Bradshaw before ‘Sex and the City!’",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-HRjghzAAu0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2012-12-18",publisher:"HarperCollins UK",subtitle:b}},{id:3953,attributes:{title:e,description:"Tells the story of Manhattan columnist Carrie Bradshaw's high school years, her relationships with her peers, and how she became a writer.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=URqFngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2010-04-27",publisher:d,subtitle:b}},{id:3954,attributes:{title:"The Carrie Diaries Complete Collection",description:"The first loves and closest friendships of Carrie Bradshaw, one of the most iconic characters of her generation, in two bestselling books by Candace Bushnell. These two books appear in one collection for the first time. In #1 New York Times bestselling The Carrie Diaries, Carrie must navigate her senior year of high school while dealing with her first real love, a friend's betrayal, her passion for writing—oh, and her future. The Carrie Diaries, a #1 New York Times bestseller, was adapted into a hit CW television series for teens. In Summer and the City, Carrie is finally out of high school and in New York City for the first time. From learning the Big Apple to meeting Samantha Jones and enrolling in a writing class, there's a new experience every minute. But how can a country mouse transform into a glamorous New Yorker of the crazy 1980s?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ad-2AwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2014-10-28",publisher:"Harper Collins",subtitle:"The Carrie Diaries, Summer and the City"}},{id:3955,attributes:{title:"Summer and the City",description:"The Sequel to the #1 New York Times Bestseller The Carrie Diaries Summer and the City brings surprising revelations as Carrie learns to navigate her way around the Big Apple, going from being a country \"sparrow\"—as Samantha Jones dubs her—to the person she always wanted to be. But as it becomes increasingly difficult to reconcile her past with her future, Carrie realizes that making it in New York is much more complicated than she ever imagined. With her signature wit and sparkling humor, Candace Bushnell reveals the irresistible story of how Carrie met Samantha and Miranda, and what turned a small-town girl into one of New York City's most unforgettable icons, Carrie Bradshaw.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F4guqAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2012-04-24",publisher:d,subtitle:b}},{id:3956,attributes:{title:"Summer and the City TV Tie-in Edition",description:"This sequel to The Carrie Diaries brings surprising revelations as Carrie learns to navigate her way around the Big Apple, going from being a country \"sparrow\" to the person she always wanted to be. With her signature wit and sparkling humor, Candace Bushnell reveals the irresistible story of how Carrie met Samantha and Miranda, and what turned a small-town girl into one of New York City's most unforgettable icons, Carrie Bradshaw. Summer is a magical time in New York City, and Carrie is in love with all of it—the crazy characters in her neighborhood, the vintage-clothing boutiques, the wild parties, and the glamorous man who has swept her off her feet. Best of all, she's finally in a real writing class, taking her first steps toward fulfilling her dream. But as it becomes increasingly difficult to reconcile her past with her future, Carrie realizes that making it in New York is much more complicated than she ever imagined. Anyone with a dream, or anyone who has wanted to create a fabulous new life, will want to follow Carrie’s adventures in glam, gritty New York City. AnnaSophia Robb starred as sixteen-year-old Carrie in the TV adaptation of the Carrie Diaries series.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NmBZvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2013-04-23",publisher:d,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940901809}}("Candace Bushnell","",null,"Balzer + Bray","The Carrie Diaries"))